import { React, useState, status } from "react";
import { Card, Form, Button, InputGroup } from 'react-bootstrap';
import DataContext from '../userContext';

function Deposit(){

    return (
        <Card
            bgcolor="primary"
            header="Deposit"
            status={status}
        >
            <Card.Header> Deposit </Card.Header>
            <Card.Body>
                <Form.Group className="mb-3" controlId="DepositAmount">
                    <Form.Label> Deposit </Form.Label>
                    <Form.control
                        type="number"
                        placeholder="0"
                    />
                </Form.Group>
            </Card.Body>
        </Card>
    )
}

export default Deposit;
